.jp-page{position:relative}
.jp-text,.jp-label{font-size:12px;white-space:nowrap;text-justify:distribute-all-lines;text-align-last:justify;-moz-text-align-last:justify;-webkit-text-align-last:justify;}
.jp-text,.jp-label,.jp-image,.jp-barcode{position:absolute;overflow:hidden}
.jp-line-horz,.jp-line-vert,.jp-table{position:absolute;}
.jp-table{min-width:1px;min-height:1px;}
.jp-table table{border-collapse:collapse}
.jp-auto-stretch,.jp-barcode object,.jp-barcode embed{width: 100%; height: 100%;}
.jp-paper-background{position:absolute;width:100%;height:100%;}
